import { FC, useContext, useState } from 'react';
import logo from '../assets/logo.png';
import { Button, Typography } from '@mui/material';
import { RecipeInfo } from '../types/recipe';

const Home: FC = () => {
  const [desserts, setDesserts] = useState<RecipeInfo[]>([]);
  const fetchAll = () => {
    setDesserts([]);
  };

  return (
    <>
      <Button onClick={fetchAll}>Fetch Dessert</Button>
      {desserts.map((dessert) => (
        <p>{dessert.title}</p>
      ))}
      <Typography variant="h2">CMAOYT Home sweet home</Typography>{' '}
      <img alt="CMAOYT logo" src={logo} />
    </>
  );
};

export default Home;
